public class Solution {
    public long ContinuousSubarrays(int[] nums) {
        long count = 0;
        int n = nums.Length;

        for (int i = 0; i < n; i++) {
            int min = nums[i];
            int max = nums[i];

            for (int j = i; j < n; j++) {
                min = Math.Min(min, nums[j]);
                max = Math.Max(max, nums[j]);

                // Check if the subarray [i, j] is continuous
                if (max - min > 2) {
                    break; // This subarray and any longer starting at i cannot be continuous
                }

                // If the condition is met, this is a valid continuous subarray
                count++;
            }
        }

        return count;
    }
}
